import requests
from bs4 import BeautifulSoup
import os
import re
from requests import request


def get_html(url):
    headers = {
        'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.132 Safari/537.36 QIHU 360SE'}
    resp = requests.get(url, headers=headers).text
    return resp


def mkdir(path):
    # 引入模块
    import os
    # 去除首位空格
    path = path.strip()
    # 去除尾部 \ 符号
    path = path.rstrip("\\")
    # 判断路径是否存在
    # 存在     True
    # 不存在   False
    isExists = os.path.exists(path)
    # 判断结果
    if not isExists:
        os.makedirs(path)
        print(path + ' 创建成功')
        return True
    else:
        # 如果目录存在则不创建，并提示目录已存在
        print(path + ' 目录已存在')
        return False


def download_img(img_url, dir, index):
    headers = {
        'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.132 Safari/537.36 QIHU 360SE'}
    r = requests.get(img_url, headers=headers, stream=True, timeout=10)
    print(r.status_code)  # 返回状态码
    if r.status_code == 200:
        open('{}\\{}.jpg'.format(dir, index), 'wb').write(r.content)  # 将内容写入图片
        print("done")
    del r


def down(uri):
    soup = BeautifulSoup(get_html(uri), "lxml")
    all_s = soup.select('#thumblist > li > a')
    title = soup.select(
        'body > div.shopdiy_mbg > div > div.fixed.product-main > div.product.fl > div.prod-title.productShowCenter_product1 > h1')
    imgs = []
    title_dir = title[0].text
    for img in all_s:
        imgs.append(img['largeimage'])
    sub_str = re.sub(u"([^\u4e00-\u9fa5\u0030-\u0039\u0041-\u005a\u0061-\u007a])", "", title_dir)

    mkpath = r"D:\\爬虫\\{}".format(sub_str)
    # # 调用函数
    mkdir(mkpath)
    for i, u in enumerate(imgs):
        download_img(u, mkpath, i)


